  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arrowwood Migratory
  Waterfowl Refuge outlines Refuge accomplishments from November, 1938 through January,
  1939. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds and predators- is also covered. The Refuge development
  and maintenance section discusses physical developments and collections and receipts.
  The public relations section of the report describes recreational uses.\",\n\t\"owner_org\":
